import React from 'react';
import Header from '../desktopVersion/header/Header';
import AboutMe from '../mobileVersion/aboutMe/AboutMe';

import './MobileVersion.css';

function MobileVersion() {
    return (
        <div>
            <Header />
            <AboutMe />
        </div>
    )
};

export default MobileVersion;
